  render() {
    const flexStyle1 = {
      backgroundColor: "#ff8080"
    };

    const flexStyle2 = {
      backgroundColor: "#99ff99"
    };


    const divStyle = {
      marginLeft: 40
    };

    return(
    <div>
      <div className="content">
        <div className="horizontal">
          <form>
            <input type="search" id="gsearch" placeholder={"search for track,artist or album"}/>
          </form>
        </div>

        <h1>Radio</h1>
        <div className="flex-container">
          <div>
            <div id="flexin" style={flexStyle1}>Radio</div>
              <div style={divStyle}>Home radio</div>
          </div>

          <div>
            <div id="flexin">Radio</div>
