          </div>

          <div>
            <div id="flexin" >Radio</div>
            <div style={divStyle}>Home radio</div>
          </div>

          <div>
            <div id="flexin" style={flexStyle2}>Radio</div>
            <div style={divStyle}>Home radio</div>
          </div>

          <div>
            <div id="flexin">Radio</div>
            <div style={divStyle}>Home radio</div>
          </div>
        </div>
      </div>
    </div>
    );
  }
}

export default Content
